import React, { useState } from "react";
import {
  AppBar,
  ButtonBase,
  Paper,
  Toolbar,
  IconButton,
  InputBase,
  Typography,
  Box,
  Checkbox,
  TextField,
  Divider,
  Drawer,
  List,
  ListItem,
  ListItemText,
  Container,
  InputAdornment,
} from "@mui/material";
import SearchIcon from "@mui/icons-material/Search";
import ExpandMoreIcon from "@mui/icons-material/ExpandMore";

const CustomButton = ({ children, onClick }) => (
	<ButtonBase
	  onClick={onClick}
	  sx={{
		width: "100%",
		height: "100%",
		textAlign: "center",
		backgroundColor: "#414fb6",
		"&:hover": {
		  backgroundColor: "#35409e", // Add a darker shade on hover
		},
	  }}
	>
	  {children}
	</ButtonBase>
  );

const SearchBar = () => {
  const [isDrawerOpen, setIsDrawerOpen] = useState(false);
  const [selectedOptions, setSelectedOptions] = useState([]);
  const [minValues, setMinValues] = useState({});
  const [maxValues, setMaxValues] = useState({});

  const handleDrawerOpen = () => {
    setIsDrawerOpen(true);
  };

  const handleDrawerClose = () => {
    setIsDrawerOpen(false);
  };

  const handleOptionToggle = (option) => () => {
    const currentIndex = selectedOptions.indexOf(option);
    const newSelectedOptions = [...selectedOptions];

    if (currentIndex === -1) {
      newSelectedOptions.push(option);
    } else {
      newSelectedOptions.splice(currentIndex, 1);
    }

    setSelectedOptions(newSelectedOptions);
  };

  const handleMinValueChange = (feature) => (event) => {
    setMinValues((prevMinValues) => ({
      ...prevMinValues,
      [feature]: event.target.value,
    }));
  };

  const handleMaxValueChange = (feature) => (event) => {
    setMaxValues((prevMaxValues) => ({
      ...prevMaxValues,
      [feature]: event.target.value,
    }));
  };

  const handleSearch = () => {
    // Implement your search logic here using selectedOptions, minValues, and maxValues
    console.log("Performing search with selected options:", selectedOptions);
    console.log("Min values:", minValues);
    console.log("Max values:", maxValues);
  };

  return (
    <Box
    sx={{ justifyContent: "center" }}
    >
    <AppBar 
      position="static" 
      sx={{ backgroundColor: "#fff",  
            minWidth: { xs: "100%", sm: "100%", md: "400px", lg: "515px" }, 
            maxWidth: "1410px", 
            mt: 1,
            mx: 2,
            border: 2,
            borderColor: "transparent",
            borderRadius: "30px" }}>
      <Toolbar color="#414fb6" sx={{ backgroundColor: "#fff", maxWidth: "1000px", borderRadius: "30px" }}>
        <IconButton
          edge="start"
          onClick={handleDrawerOpen}
          sx={{ color: "#414fb6" }}
        >
          <SearchIcon />
        </IconButton>
        <Typography
          onClick={handleDrawerOpen}
          sx={{ ml: 1, flex: 1, color: "#414fb6" }}
          >
            Search...
        </Typography>
      </Toolbar>
      <Drawer
        anchor="bottom"
        open={isDrawerOpen}
        onClose={handleDrawerClose}
      >
        <Container>
        <Box sx={{
            p: 1,
            display: "flex",
            flexDirection: "row",
            justifyContent: "space-between"
          }}>
            <Typography 
					    variant="h5"
					    fontFamily="Poppins"
					    color="#414fb6"
					    sx={{
                py: 2,
				      	overflow: "hidden",
				        textOverflow: "ellipsis",
				       	whiteSpace: "nowrap",
					    	fontWeight: 700,
				    	}}
					    component="div">
                Company Search
            </Typography>
            <Paper
									elevation={3}
									sx={{
                      mt: 2,
		  								border: 2,
		  								borderColor: "transparent",
		  								borderRadius: "10px",
		  								minWidth: { xs: "100%", sm: "100%", md: "200px", lg: "200px" },
		  								maxWidth: "200px",
		  								height: "40px",
										backgroundColor: "#414fb6"
									}}
	  							>
									<Box
		 								sx={{
											justifyContent: "flex-start",
											width: "100%",
											borderRadius: "10px",
											px: "14px",
											py: "4px",
											"&.Mui-active": {
			  									border: "4px solid #482FD7",
											},
											textAlign: "center",
											color: "#fff",
		  								}}
									>
